import {useState} from 'react'

const useFetchdata = (url) => {
    const [userData, setuserData] = useState([]);
    useEffect(()=>{
        async function fetchData() {
            const response = await fetch(url);
            const data = await response.json();
            console.log(data);
            setuserData(data)
          }
    },[])

    return userData
}

export default useFetchdata
